import React from 'react';
import {Keyboard, Text, TextInput, TouchableWithoutFeedback, View} from "react-native";
import * as yup from "yup";
import {Formik} from "formik";
import FlatButton from "../components/Button";

const pwSchema = yup.object({
    email: yup.string()
        .email()
        .required('Nem megfelelő felhasználónév!'),

});

export const ForgotPassword = () => {

    return(
        <View>
            <TouchableWithoutFeedback onPress={Keyboard.dismiss}>
                <View>
                    <View>
                        <Text style={styles.header}>ELFELEJTETT JELSZÓ</Text>
                    </View>
                    <View style={styles.pwForm}>
                        <Formik
                            initialValues={{ email: ''}}
                            validationSchema={pwSchema}
                            onSubmit={(values, actions) => {
                                actions.resetForm();
                                console.log(values);
                            }}>
                            {(props) => (
                                <View>
                                    <TextInput style={styles.textinput}
                                               placeholder="Email cím"
                                               value={props.values.password}
                                               onChangeText={props.handleChange('email')}
                                               onBlur={props.handleBlur('email')}
                                               underlineColorAndroid={'transparent'} />
                                    <Text style={styles.errorText} >{props.touched.email && props.errors.email}</Text>
                                    <FlatButton text="Mégsem"  />
                                    <FlatButton text="Mehet!" onPress={props.handleSubmit} />
                                </View>
                            )}
                        </Formik>
                    </View>
                </View>
            </TouchableWithoutFeedback>
        </View>
    )
};
